        display: inline-block;

        .loader {

        z-index: 99;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        background: white;
        display: flex;
        justify-content: center;
        align-items: center;
    }

        width: 100px;
    }

        animation-fill-mode: forwards;
    }

        100% {
            opacity: 0;
            visibility: hidden;
        }
    }
